import React, { Component } from 'react';
import NavList from '../block/NavList';
import Logo from '../atoms/Logo.js';

export default function Footer() {
    const FooterStyle = {
        background: "#333"

    }
    const NavStyle = {
        display: "flex"
    }
    return (
        <footer>
            <div style={ FooterStyle }>
                <Logo />
                <NavList style={ NavStyle } />
            </div>
        </footer>
    );
}
